import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <>
      <div className="mainHeader">
        <div>
          <h1>React Meals</h1>
        </div>
        <div>
            <div className="cart">
                <h4>Your cart</h4>
            </div>
        </div>
      </div>
    </>
  );
};

export default Header;
